int CxiBuilder::BuildExeFS(void)
{
	// Compress .code if necessary
	if (exh.sysCtrlInfo.flag & SystemControlInfo::Flag_IsCompressed)
	{
		u32 newSize = 0;
		void* newCode = BLZ_Code((u8*)codeData, codeSize, &newSize, BLZ_NORMAL);
		if (!newCode)
		{
			fprintf(stderr, "Error while compressing .code\n");
			return 1;
		}
		free(codeData);
		codeData = newCode;
		codeSize = newSize;
	}

	int pos = 0;
	exefs.AddFile(pos++, ".code", codeData, codeSize);
	if (exh.accessCtrlInfo.localCaps11.resourceLimitType == Arm11LocalCaps::Application)
		exefs.AddFile(pos++, "logo", ExeFSHeader::s_homebrewLogo, sizeof(ExeFSHeader::s_homebrewLogo));
	if (icnPresent)
		exefs.AddFile(pos++, "icon", &icnData, sizeof(icnData));
	if (bnrData)
		exefs.AddFile(pos++, "banner", bnrData, bnrSize);

	hdr.exefsSize = le_word(exefs.TotalSizeMediaUnits());
	hdr.exefsHashedSize = le_word(sizeof(exefs) / NcchHeader::kMediaUnitSize);
	Crypto::Sha256((const u8*)&exefs, sizeof(exefs), hdr.exefsHash);
	return 0;
}
